INSERT INTO `movies` (`id`, `title`, `description`, `release_date`, `duration`, `poster`, `rating`, `age_rating`, `price`, `genres`, `createdAt`, `updatedAt`) VALUES
('MV-7d924420-1734-11ee-91b0-a92a6ea8b304', 'Fast X', 'Dom Toretto dan keluarganya menjadi sasaran putra gembong narkoba Hernan Reyes yang pendendam.', '2023-05-17', '2h 21m', 'https://image.tmdb.org/t/p/w500/fiVW06jE7z9YnO4trhaMEdclSiC.jpg', 3.4, 15, 53000, '[\"Action\", \"Adventure\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d924421-1734-11ee-91b0-a92a6ea8b304', 'John Wick: Chapter 4', 'John Wick mengungkap jalan untuk mengalahkan The High Table. Tapi sebelum dia bisa mendapatkan kebebasannya, Wick harus berhadapan dengan musuh baru dengan aliansi kuat di seluruh dunia dan kekuatan yang mengubah teman lama menjadi musuh.', '2023-03-22', '2h 49m', 'https://image.tmdb.org/t/p/w500/vZloFAK7NmvMGKE7VkF5UHaz0I.jpg', 4, 10, 60000, '[\"Action\", \"Neo-noir\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d924422-1734-11ee-91b0-a92a6ea8b304', 'The Super Mario Bros. Movie', 'Ketika sedang bekerja di bawah tanah untuk memperbaiki pipa air, Mario dan Luigi, yang merupakan tukang ledeng dari Brooklyn, tiba-tiba terhisap ke dalam pipa misterius dan masuk ke dunia yang sangat berbeda. Mereka berada di tempat yang ajaib dan aneh. Tapi sayangnya, mereka terpisah satu sama lain. Mario memulai petualangan besar untuk mencari dan menemukan Luigi.', '2023-04-05', '1h 32m', 'https://image.tmdb.org/t/p/w500/qNBAXBIQlnOThrVvA6mA2B5ggV6.jpg', 4.6, 14, 49000, '[\"Adventure\", \"Comedy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d924423-1734-11ee-91b0-a92a6ea8b304', 'Avatar: The Way of Water', 'Jake Sully tinggal bersama keluarga barunya di planet Pandora. Setelah ancaman kembali datang, Jake harus bekerja dengan Neytiri dan pasukan ras Na\'vi untuk melindungi planet mereka.', '2022-12-14', '3h 12m', 'https://image.tmdb.org/t/p/w500/t6HIqrRAclMCA60NsSmeqe9RmNV.jpg', 4.4, 12, 53000, '[\"Sci-fi\", \"Action\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d924424-1734-11ee-91b0-a92a6ea8b304', 'Guardians of the Galaxy Vol. 3', 'Peter Quill masih trauma karena kehilangan Gamora. Ia perlu mengumpulkan timnya untuk melindungi alam semesta dan salah satu anggota mereka. Jika mereka gagal, Guardian akan berakhir.', '2023-05-03', '2h 29m', 'https://image.tmdb.org/t/p/w500/nAbpLidFdbbi3efFQKMPQJkaZ1r.jpg', 4.1, 12, 41000, '[\"Action\", \"Sci-fi\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d924425-1734-11ee-91b0-a92a6ea8b304', 'Ant-Man and the Wasp: Quantumania', 'Scott Lang dan Hope van Dyne adalah pasangan pahlawan super. Mereka pergi bersama orang tua Hope, Janet van Dyne dan Hank Pym, serta anak perempuan Scott, Cassie Lang, untuk menjelajahi Alam Kuantum. Di sana, mereka bertemu dengan makhluk-makhluk aneh dan memulai petualangan yang tak terduga. Petualangan ini akan menguji batas-batas mereka.', '2023-02-15', '2h 4m', 'https://image.tmdb.org/t/p/w500/g0OWGM7HoIt866Lu7yKohYO31NU.jpg', 3.4, 12, 51000, '[\"Action\", \"Adventure\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d924426-1734-11ee-91b0-a92a6ea8b304', 'The Pope\'s Exorcist', 'Pastor Gabriele Amorth, yang memimpin tim pengusir setan di Vatikan, menginvestigasi kasus kekerasan roh jahat yang menghantui seorang anak laki-laki. Dalam penyelidikannya, ia secara tak terduga menemukan rahasia tua yang disembunyikan oleh Vatikan selama berabad-abad.', '2023-04-05', '1h 43m', 'https://image.tmdb.org/t/p/w500/gNPqcv1tAifbN7PRNgqpzY8sEJZ.jpg', 3.7, 13, 51000, '[\"Horror\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d924428-1734-11ee-91b0-a92a6ea8b304', 'Transformers: Age of Extinction', 'Lima tahun setelah Chicago dihancurkan, manusia berbalik melawan robot. Namun seorang ayah tunggal dan penemu membangkitkan robot yang dapat menyelamatkan dunia.', '2014-06-25', '2h 45m', 'https://image.tmdb.org/t/p/w500/jyzrfx2WaeY60kYZpPYepSjGz4S.jpg', 3.9, 11, 54000, '[\"Action\", \"Sci-fi\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b30-1734-11ee-91b0-a92a6ea8b304', 'Puss in Boots: The Last Wish', 'Puss in Boots menemukan fakta bahwa kecintaannya pada petualangan telah merenggut nyawanya: dia telah menghabiskan delapan dari sembilan nyawanya. Puss kini memulai petualangan epik untuk menemukan harapan terakhir untuk memulihkan sembilan nyawanya.', '2022-12-07', '1h 42m', 'https://image.tmdb.org/t/p/w500/kuf6dutpsT0vSVehic3EZIqkOBt.jpg', 4.8, 11, 51000, '[\"Adventure\", \"Comedy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b31-1734-11ee-91b0-a92a6ea8b304', 'Scream VI', 'Setelah pembunuhan terbaru oleh Ghostface, keempat orang yang selamat pergi dari Woodsboro dan memulai hidup baru.', '2023-03-08', '2h 2m', 'https://image.tmdb.org/t/p/w500/wDWwtvkRRlgTiUr6TyLSMX8FCuZ.jpg', 3.8, 12, 36000, '[\"Horror\", \"Slasher\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b32-1734-11ee-91b0-a92a6ea8b304', 'Black Adam', 'Hampir 5.000 tahun setelah dia dianugerahi kekuatan maha kuasa para dewa Mesirâ€”dan dipenjara dengan cepatâ€”Black Adam dibebaskan dari makam duniawinya, siap untuk melepaskan bentuk keadilannya yang unik di dunia modern.', '2022-10-19', '2h 5m', 'https://image.tmdb.org/t/p/w500/A5imhXiFF3AL9RRA4FBzNDFmfgW.jpg', 4.2, 10, 42000, '[\"Action\", \"Adventure\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b33-1734-11ee-91b0-a92a6ea8b304', 'Dungeons & Dragons: Honor Among Thieves', 'Seorang pencuri menawan dan sekelompok petualang yang unik melakukan pencurian besar-besaran untuk mencuri relik yang hilang. Namun, segalanya menjadi kacau ketika mereka berjumpa dengan orang yang salah.', '2023-03-23', '2h 14m', 'https://image.tmdb.org/t/p/w500/A7AoNT06aRAc4SV89Dwxj3EYAgC.jpg', 4.3, 12, 38000, '[\"Adventure\", \"Fantasy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b34-1734-11ee-91b0-a92a6ea8b304', 'Peter Pan & Wendy', 'Wendy Darling adalah seorang gadis kecil yang takut pergi dari rumah masa kecilnya. Suatu hari, dia bertemu dengan Peter Pan, seorang anak laki-laki yang tidak mau tumbuh dewasa. Mereka bersama saudara-saudaranya dan peri kecil bernama Tinker Bell pergi ke dunia ajaib yang disebut Neverland. Di sana, mereka menghadapi Kapten Hook, seorang bajak laut jahat, dan mengalami petualangan seru yang akan mengubah hidup Wendy selamanya.', '2023-04-20', '1h 49m', 'https://image.tmdb.org/t/p/w500/9NXAlFEE7WDssbXSMgdacsUD58Y.jpg', 1.9, 13, 35000, '[\"Adventure\", \"Fantasy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b35-1734-11ee-91b0-a92a6ea8b304', 'Spider-Man: No Way Home', 'Peter Parker menghadapi masalah besar. Hal ini terjadi setelah identitasnya sebagai Spiderman terungkap. Dengan kepergian Tony Stark, Peter Parker pun harus meminta bantuan Doctor Strange agar semua orang bisa melupakan identitasnya sebagai manusia laba-laba.', '2021-12-15', '2h 28m', 'https://image.tmdb.org/t/p/w500/uJYYizSuA9Y3DCs0qS4qWvHfZg4.jpg', 4.8, 15, 56000, '[\"Action\", \"Adventure\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b36-1734-11ee-91b0-a92a6ea8b304', 'Black Panther: Wakanda Forever', 'Rakyat Wakanda kali ini akan berjuang untuk melindungi negerinya dari campur tangan kekuatan dunia setelah kematian sang Raja T\'Challa.', '2022-11-09', '2h 41m', 'https://image.tmdb.org/t/p/w500/sv1xJUazXeYqALzczSZ3O6nkH75.jpg', 3.9, 13, 39000, '[\"Action\", \"Adventure\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b37-1734-11ee-91b0-a92a6ea8b304', 'Transformers: The Last Knight', 'Di tengah ketidakhadiran Optimus Prime, umat manusia berperang melawanTransformers untuk mempertahankan eksistensinya. Cade Yeager membentuk kerjasama dengan Bumblebee, seorang bangsawan Inggris dan seorang professor dari Oxford untuk mempelajari mengapa Transformers selalu kembali ke planet bumi.', '2017-06-16', '2h 29m', 'https://image.tmdb.org/t/p/w500/s5HQf2Gb3lIO2cRcFwNL9sn1o1o.jpg', 3.7, 12, 52000, '[\"Action\", \"Sci-fi\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b38-1734-11ee-91b0-a92a6ea8b304', 'Renfield', 'Setelah bertahun-tahun sebagai hamba Dracula yang merasa jenuh dan lelah, Renfield menemukan harapan baru dalam hidupnya. Dia jatuh cinta pada Rebecca Quincy, seorang polisi lalu lintas yang energik dan sering marah. Kesempatan ini bisa menjadi penebusan baginya.', '2023-04-07', '1h 33m', 'https://image.tmdb.org/t/p/w500/2OaprROMZZeiWsydjGUIkXrv2Z3.jpg', 4, 14, 51000, '[\"Horror\", \"Comedy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b39-1734-11ee-91b0-a92a6ea8b304', 'Cocaine Bear', 'Sekelompok polisi, penjahat, turis, dan remaja eksentrik berkumpul di hutan Georgia tempat beruang hitam besar mengamuk setelah menelan kokain secara tidak sengaja.', '2023-02-22', '1h 35m', 'https://image.tmdb.org/t/p/w500/gOnmaxHo0412UVr1QM5Nekv1xPi.jpg', 3.2, 12, 53000, '[\"Horror\", \"Comedy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b3a-1734-11ee-91b0-a92a6ea8b304', 'Prey', 'Di Comanche Nation pada tahun 1717, seorang pejuang yang ganas dan sangat terampil bernama Naru mengetahui bahwa mangsa yang dia intai adalah alien yang sangat berkembang dengan persenjataan berteknologi maju.', '2022-08-02', '1h 40m', 'https://image.tmdb.org/t/p/w500/ujr5pztc1oitbe7ViMUOilFaJ7s.jpg', 4.3, 10, 42000, '[\"Action\", \"Sci-fi\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b3b-1734-11ee-91b0-a92a6ea8b304', 'Fall', 'Untuk sahabat Becky dan Hunter, hidup adalah tentang menaklukkan ketakutan dan mendorong batas. Tetapi setelah mereka mendaki 2.000 kaki ke puncak menara radio terpencil yang ditinggalkan, mereka menemukan diri mereka terdampar tanpa jalan turun. Sekarang keterampilan panjat ahli Becky dan Hunter akan diuji saat mereka mati-matian berjuang untuk bertahan hidup dari unsur-unsur, kurangnya persediaan, dan ketinggian yang menyebabkan vertigo.', '2022-08-11', '1h 47m', 'https://image.tmdb.org/t/p/w500/v28T5F1IygM8vXWZIycfNEm3xcL.jpg', 4, 11, 39000, '[\"Thriller\", \"Survival\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b3c-1734-11ee-91b0-a92a6ea8b304', 'Avatar', 'Pada abad ke-22, seorang Marinir lumpuh dikirim ke Pandora bulan pada misi yang unik, tetapi menjadi terpecah antara mengikuti perintah dan melindungi peradaban alien.', '2009-12-15', '2h 42m', 'https://image.tmdb.org/t/p/w500/kyeqWdyUXW608qlYkRqosgbbJyK.jpg', 4.6, 13, 37000, '[\"Action\", \"Adventure\", \"Fantasy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b3d-1734-11ee-91b0-a92a6ea8b304', 'Split', 'Ketika ketiga gadis remaja sedang menunggu ayah mereka di dalam mobil, seorang pria misterius menculik dan membawa mereka ke dalam sebuah bunker. Sang penculik yang bernama Kevin (James McAvoy) adalah seorang pria dengan gangguan jiwa yang membuatnya memiliki 23 kepribadian yang berbeda, yang diantaranya adalah seorang wanita dan anak berumur 9 tahun yang bernama Hedwig.  Sebagai salah satu gadis yang diculik, Casey berusaha meloloskan diri dengan meyakinkan salah satu kepribadian Kevin untuk melepaskan mereka. Akan tetapi hal tersebut tidaklah mudah, terlebih setelah Hedwig memperingatkan mereka akan the Beast yang merupakan kepribadian Kevin yang paling berbahaya.', '2017-01-19', '1h 57m', 'https://image.tmdb.org/t/p/w500/lli31lYTFpvxVBeFHWoe5PMfW5s.jpg', 4.3, 10, 45000, '[\"Thriller\", \"Horror\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b3e-1734-11ee-91b0-a92a6ea8b304', 'Top Gun: Maverick', 'Setelah lebih dari tiga puluh tahun mengabdi sebagai salah satu penerbang top Angkatan Laut, dan menghindari kenaikan pangkat yang akan menjatuhkannya, Pete \'Maverick\' Mitchell mendapati dirinya melatih satu detasemen lulusan TOP GUN untuk misi khusus yang tidak ada kehidupan. pilot pernah melihat.', '2022-05-24', '2h 10m', 'https://image.tmdb.org/t/p/w500/jeGvNOVMs5QIU1VaoGvnd3gSv0G.jpg', 4.8, 14, 57000, '[\"Action\", \"Adventure\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b3f-1734-11ee-91b0-a92a6ea8b304', 'Thor: Love and Thunder', '\'Thor: Love and Thunder\'menceritakan Thor (Chris Hemsworth) dalam sebuah perjalanan yang belum pernah ia jalani â€“ pencariankedamaian batin. Namun, masa pensiunnya terganggu oleh seorang pembunuh galaksi yang dikenal sebagai Gorr sang Dewa Jagal (Christian Bale), yang ingin memusnahkan para dewa. Untuk mengatasi ancaman, Thor meminta bantuan Raja Valkyrie (Tessa Thompson), Korg (Taika Waititi), dan mantan kekasihnya Jane Foster (Natalie Portman), yang secara mengejutkan dan misterius berhasil menggunakan palu ajaibnya, Mjolnir, sebagai Mighty Thor. Bersama, mereka memulai petualangan kosmik yang mendebarkan untuk mengungkap misteri pembalasan Dewa Jagal dan menghentikannya sebelum terlambat.', '2022-07-06', '1h 59m', 'https://image.tmdb.org/t/p/w500/pIkRyD18kl4FhoCNQuWxWu5cBLM.jpg', 3.2, 12, 35000, '[\"Action\", \"Adventure\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b40-1734-11ee-91b0-a92a6ea8b304', 'Sonic the Hedgehog 2', 'Alur cerita film Sonic the Hedgehog 2 bermula ketika Sonic menetap di Green Hills. Ia memutuskan menetap di sana agar bisa merasakan lebih banyak kebebasan. Ditambah lagi, Tom dan Maddie setuju untuk meninggalakannya di rumah ketika mereka pergi untuk berlibur. Namun sayangnya, tidak lama setelah mereka pergi Dr. Robotnik sang musuh bubuyutan si landak biru itu kembali ke bumi. Kali ini Dr. Robotnik datang dengan pasukan baru, Knuckles. Tujuan mereka datang kembali adalah untuk mencari Master Emerald yang memiliki kekuatan super. Kekuatan super itu bisa membangun dan menghancurkan peradaban di bumi. Atas hal ini, Sonic pun mencari strategi agar bisa menggagalkan rencara Dr. Robotnik. Strategi yang dilakukan oleh Sonic ialah bekerjasama dengan sahabatnya, Tails. Kemudian bersama dengan Tails, Sonic memulai perjalanan untuk menemukan Master Emerald. Semua itu dilakukan dengan cepat, sebelum Master Emerald jatuh ke tangan yang salah.', '2022-04-08', '2h 2m', 'https://image.tmdb.org/t/p/w500/6DrHO1jr3qVrViUO6s6kFiAGM7.jpg', 4.7, 12, 45000, '[\"Action\", \"Adventure\", \"Comedy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b41-1734-11ee-91b0-a92a6ea8b304', 'Avengers: Infinity War', 'Karena Avengers dan sekutunya terus melindungi dunia dari ancaman yang terlalu besar untuk ditangani oleh seorang pahlawan, bahaya baru telah muncul dari bayangan kosmik: Thanos. Seorang lalim penghujatan intergalaksi, tujuannya adalah untuk mengumpulkan semua enam Batu Infinity, artefak kekuatan yang tak terbayangkan, dan menggunakannya untuk menimbulkan kehendak memutar pada semua realitas. Segala sesuatu yang telah diperjuangkan oleh Avengers telah berkembang hingga saat ini - nasib Bumi dan keberadaannya sendiri tidak pernah lebih pasti.', '2018-04-25', '2h 29m', 'https://image.tmdb.org/t/p/w500/7WsyChQLEftFiDOVTGkv3hFpyyt.jpg', 4.7, 10, 46000, '[\"Action\", \"Sci-fi\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b42-1734-11ee-91b0-a92a6ea8b304', 'The Whale', 'Seorang guru bahasa Inggris yang tertutup dan gemuk mencoba untuk berhubungan kembali dengan putri remajanya yang terasing.', '2022-12-09', '1h 57m', 'https://image.tmdb.org/t/p/w500/jQ0gylJMxWSL490sy0RrPj1Lj7e.jpg', 4.3, 15, 55000, '[\"Drama\", \"Narrative\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b43-1734-11ee-91b0-a92a6ea8b304', 'The Batman', 'Ketika seorang pembunuh berantai sadis mulai membunuh tokoh-tokoh politik penting di Gotham, Batman terpaksa menyelidiki korupsi tersembunyi di kota itu dan mempertanyakan keterlibatan keluarganya.', '2022-03-01', '2h 56m', 'https://image.tmdb.org/t/p/w500/seyWFgGInaLqW7nOZvu0ZC95rtx.jpg', 3.9, 13, 53000, '[\"Action\", \"Crime\", \"Drama\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b44-1734-11ee-91b0-a92a6ea8b304', 'Smile', 'Setelah menyaksikan kejadian aneh dan traumatis yang melibatkan seorang pasien, Dr. Rose Cotter mulai mengalami kejadian menakutkan yang tidak dapat dia jelaskan. Saat teror luar biasa mulai mengambil alih hidupnya, Rose harus menghadapi masa lalunya yang bermasalah untuk bertahan hidup dan melarikan diri dari kenyataan barunya yang mengerikan.', '2022-09-23', '1h 55m', 'https://image.tmdb.org/t/p/w500/67Myda9zANAnlS54rRjQF4dHNNG.jpg', 3.7, 11, 38000, '[\"Horror\", \"Mystery\", \"Thriller\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30'),
('MV-7d926b45-1734-11ee-91b0-a92a6ea8b304', 'Encanto', 'menceritakan tentang keluarga Madrigals, sebuah keluarga yang tinggal di rumah ajaib dan masing-masing anggota keluarga memiliki keajaibannya tersendiri. Pada jaman dahulu kala, Abuela bersama suami dan anak-anaknya melarikan diri dari kerusuhan di desa.', '2021-10-13', '1h 49m', 'https://image.tmdb.org/t/p/w500/4j0PNHkMr5ax3IA8tjtxcmPU3QT.jpg', 4.4, 12, 44000, '[\"Family\", \"Comedy\"]', '2023-06-30 10:54:30', '2023-06-30 10:54:30');
